import React from 'react';
import Banner from '../../images/library.png';
import FeatherIcon from '../../images/feather.png';
import styles from './Acount.module.css';

function Acount() {
  const backgroundImageStyle = { backgroundImage: `url(${Banner})` };
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  return (
    <div className={styles.acount}>
      <div className={styles.banner} style={backgroundImageStyle} />
      <main className={styles.main}>
        <button
          type="button"
          className={styles.Button}
          aria-label="edit"
        >
          Editer Profile
          <img
            src={FeatherIcon}
            alt="Feather Icon"
            className={styles.icon}
          />
        </button>
        <section className={styles.info}>
          <article>
            <label htmlFor="username">
              <p>Pseudo</p>
              <input
                type="text"
                name="username"
                id="username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
            </label>

            <label htmlFor="email">
              <p>E-mail</p>
              <input
                type="email"
                name="email"
                id="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </label>
          </article>
          <aside>aside</aside>
        </section>
        <section className={styles.notif}>
          <h4>h4</h4>
          <article>article</article>
        </section>
        <section className={styles.pres}>
          <h4>h4</h4>
          <article>article</article>
        </section>
      </main>
    </div>

  );
}

export default Acount;
